  Refuge Waterfowl Management Program was conducted on December 15-16, 1987. Members
  of the review team included Refuge Manager Glen Bond, Wildlife and Habitat Management
  Division Chief Frank Bowers, District 5 Supervisor Don Adams, South Carolina Marine
  and Wildlife Resources Department Waterfowl Project Leader Tommy Strange, and District
  Biologist Otto Florschutz. Assistant Regional Director Harold Benson and District
  3 Supervisor Travis McDaniel also were present and contributed to the review.\",\n\t\"owner_org\":
